import React from "react";
import ReactDOM from "react-dom";
import useFetch from "./useFetch";

const Webcams = () => {
    const { data: webcams, isPending, error } = useFetch("https://developer.nps.gov/api/v1/parks?limit=1000&api_key=gUeSemHr93mXuKE5WqakVIaO2cDN67aqXettWyDE");
    //console.log(parks);
    //const parks = data;
    //const [Activities, setActivities] = useState([]);

    /*const handleActivitySearch = (activity) => {
        const newParks = parks.filter(park => park.activities !== activity);
        setParks(newParks);
    }*/

    return (  
        <div className="ParksList">
        <h2>All Parks</h2>
            { error && <div>{ error }</div> }
            { isPending && <div>Loading...</div> }
            { webcams && (
                webcams.data.map((webcam)=>(
                    (webcam.data.map((images)=>(
                        <div>
                        <img 
                        src={images.url}
                        alt="new"
                        />
                        </div>
                        )))

                ))
            )}
        </div>
    );
}

export default Webcams;
